import React, { Component } from 'react';
import Layout from "../components/Layout";
// import { MDBRow, MDBCol, MDBCard, MDBCardBody, MDBIcon, MDBBtn, MDBInput } from "mdbreact";



class Contact extends Component {


    render() {

        return (
            <div>
                <Layout title="Contact">
                    <div className=" bg-header jumbotron jumbotron-fluid  ">
                        <div className="container wheat">
                            <div className="row">
                                <div className="col-auto">
                                    {/* <p className="lead wheat mt-5">#</p> */}
                                    <h1 className="display-4 wheat mb-5">Contact </h1>
                                </div>
                            </div>
                        </div>
                    </div>

                    <section className="page-section" id="contact">
                        <div className="container">
                            <div className="row">
                                <div className="col-lg-12 text-center mt-5">
                                    <h2 className="section-heading text-uppercase">Contact Us</h2>
                                    <h3 className="section-subheading text-muted">Lorem ipsum dolor sit amet consectetur.</h3>
                                </div>
                            </div>
                            <div className="row">
                                <div className="col-lg-12">>
                                        <div className="row">
                                        <div className="col-md-auto">
                                            <div className="form-group">
                                                <div className ="iframe">
                                                    <iframe src="https://docs.google.com/forms/d/e/1FAIpQLSe6P5GaJOfsPAXb8D2kDQ7XobT8CIAOn2muwgk3GhTZXzVKaw/viewform?embedded=true"
                                                      className = "container"  width="640" height="850" frameborder="0" marginheight="0" marginwidth="0">กำลังโหลด…</iframe>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </section>
                </Layout>
            </div>
        );
    }
}

export default Contact;




